INSERT INTO "product" VALUES (34, 'HRE Performance Wheels HRE P101', 12999.99, 'HRE P101 to felga klasy ultra premium, ręcznie produkowana w USA z najwyższą dbałością o detale. Stosowana w autach super-sportowych i luksusowych, łączy w sobie ekstremalną wytrzymałość z ultralekką konstrukcją, co przekłada się na poprawę dynamiki jazdy oraz komfortu. HRE oferuje szerokie możliwości personalizacji — od kolorów, przez detale wykończenia, aż po rozmiary, aby idealnie dopasować felgi do indywidualnego stylu auta i gustu właściciela. To wybór dla najbardziej wymagających entuzjastów motoryzacji, którzy oczekują perfekcji w każdym calu.', 100, 'RIM')ON CONFLICT (id) DO NOTHING;
INSERT INTO "product" VALUES (9, 'Michelin Pilot Sport 4S', 1499.99, 'Michelin Pilot Sport 4S to opona PREMIUM stworzona z myślą o wysokich osiągach oraz doskonałej przyczepności na suchych i mokrych nawierzchniach. Idealna dla samochodów sportowych i luksusowych, które wymagają maksymalnej kontroli i stabilności przy dynamicznej jeździe. Opona łączy zaawansowane technologie mieszanki gumowej oraz innowacyjny bieżnik, co przekłada się na bardzo krótki hamowania i wysoką trwałość. Michelin Pilot Sport 4S to wybór dla kierowców, którzy nie uznają kompromisów w kwestii bezpieczeństwa i komfortu. https://res.cloudinary.com/dusiv8svt/image/upload/v1747750191/vvgxiwfrtmos0mw7hetw.png', 156, 'TIRE')ON CONFLICT (id) DO NOTHING;
